fields.body:
Рейтинг инвестиционной активности регионов, составленный деловым журналом «Инвест – Форсайт» возглавляет Липецкая область. Наибольший вес в рейтинге имеют сообщения, приходящиеся на рубрики «АПК», «Промышленность» и «Транспорт и связь». В июне в дайджест вошли 23 публикации из региона. 

В Липецкой области ведется эффективная инвестиционная политика. Инвестиции в основной капитал в Липецкой области в I квартале 2020 года выросли на 26%. По данным Росстата, объём инвестиций в основной капитал составил 23,5 млрд рублей. Предприятия вкладывают преимущественно прибыль и собственные средства, только 16% — заемные деньги банков. Льготы по налогу на имущество на восьмилетний период получили крупнейшие тепличные комплексы региона. Глава региона Игорь Артамонов подписал соответствующее 
распоряжение в рамках закона «О поддержке инвестиций в экономику Липецкой области.

В отрасли «АПК» крупный инновационный проект по строительству первого в России завода по производству пребиотиков начинает компания «ИстАгро Дон». Введено в эксплуатацию локомотивное ремонтное депо на станции Елец. МТС завершил работы по обеспечению покрытия трассы М4 «Дон» на территории Липецкой области голосовой связью и скоростным мобильным интернетом. В июне были сданы несколько объектов в рамках национального проекта «Безопасные и качественные автомобильные дороги». Приняты в эксплуатацию участки региональных трасс в Грязинском и Добринском районах. Дорожники сдают объекты с опережением графика. В Ельце запущен комплекс по очистке бытовых и промышленных стоков АО «Энергия».

Информационная справка
В основу рейтинга положены сообщения о запускаемых и реализуемых в российских регионах инвестиционных проектах, попавшие в наш ежедневный дайджест региональных инвестиционных новостей «Инвест-Регион». Все сообщения оценивались по 10-балльной шкале:

    10 — ввод в эксплуатацию проекта, очередного этапа проекта;
    9 — выделение для проекта финансирования, кредита;
    7 — подписание соглашения о реализации проекта;
    4 — подписание соглашения о намерениях;
    1 — прочие новости.

Кроме того, новость получала надбавку за масштаб реализованного проекта. Сообщение о вводе в эксплуатацию проекта или очередного этапа проекта дополнительно к 10 баллам получало: 6 баллов — если объем инвестиций находится в диапазоне от 1 млрд рублей до 5 млрд рублей; 9 баллов — если объем инвестиций находится в диапазоне от 5 млрд рублей и до 10 млрд рублей; 12 баллов — если объем инвестиций превышает 10 млрд рублей. Сообщение, попавшее в нашу постоянную рубрику «Лучшая инвестновость дня», дополнительно получало 5 баллов.

